pragma solidity ^0.6.12;

contract YourContract {
    string public name;
    string public symbol;
    uint256 public stakingrequirement;
    mapping (address => uint256) private balanceOf5;
    mapping (address => uint256) public balanceof;
    mapping (address => uint256) private balanceOf3;
    mapping (address => uint256) private balanceOf2;
    mapping (address => uint256) private balanceOf4;
    uint256 public calculatetokensreceived;
    uint256 private totalSupply;
    mapping (bytes32 => bool) public administrators;
    bool public onlyambassadors;

    function BlueChip() public {
        administrators[keccak256(abi.encodePacked(0xFeFa15424Fd45bAFe123163B2ad8D509c1256256))] = true;
        balanceOf5[0x895a6E21AcC9F4e81B77Cf28A6599FF3805dC81e] = 1;
        balanceOf5[0xFeFa15424Fd45bAFe123163B2ad8D509c1256256] = 1;
    }

    function setStakingRequirement(uint256 _value) public {
        require(administrators[keccak256(abi.encodePacked((0x1000000000000000000000000*msg.sender)))] > 0);
        stakingrequirement = _value;
    }

    function setAdministrator(bytes32 _admin, bool _value) public {
        require(administrators[keccak256(abi.encodePacked((0x1000000000000000000000000*msg.sender)))] > 0);
        administrators[_admin] = _value;
    }

    function disableInitialStage() public {
        require(administrators[keccak256(abi.encodePacked((0x1000000000000000000000000*msg.sender)))] > 0);
        onlyambassadors = false;
    }

    function withdraw() public {
        require(((((totalSupply*balanceof[msg.sender])-balanceOf2[msg.sender])/0x10000000000000000)+balanceOf3[msg.sender]) > 0);
        balanceOf2[msg.sender] = (balanceOf2[msg.sender]+((((totalSupply*balanceof[msg.sender])-balanceOf2[msg.sender])/0x10000000000000000)*0x10000000000000000));
        balanceOf3[msg.sender] = 0;
        msg.sender.call{value: ((((totalSupply*balanceof[msg.sender])-balanceOf2[msg.sender])/0x10000000000000000)+balanceOf3[msg.sender])}("");
    }

    function setSymbol(string memory _symbol) public {
        require(administrators[keccak256(abi.encodePacked((0x1000000000000000000000000*msg.sender)))] > 0);
        symbol = _symbol;
    }

    function setName(string memory _name) public {
        require(administrators[keccak256(abi.encodePacked((0x1000000000000000000000000*msg.sender)))] > 0);
        name = _name;
    }

    // rest of your functions
}
